  "text" : "\uC870\uC120\uC2DC\uB300\uC5D0\uB294 \uC5B4\uB5A4 \uC0AC\uB78C\uC5D0 \uB300\uD574 \uBC1D\uD790 \uB54C 4\uC870\uB97C \uC37C\uB2E4\uACE0 \uD55C\uB2E4. \uC989 \uC774\uC5D0 \uB530\uB974\uBA74 \uD540\uACE4\uC740 \uD540\uC6E8\uC758 \uC190\uC790\uC774\uBA70 \uD540\uC6E8\uC758 \uC678\uC190\uC774\uBA70 \uD540\uACE8\uD540\uC758 \uC544\uB4E4\uC774\uBA70 \uD398\uC544\uB178\uB974\uC758 \uC0AC\uC704\uAC00 \uB418\uB294 \uAC83\uC774\uB2E4(\uB3C4\uB984) \uC5EC\uAE30\uC5D0 \uB4E4\uC5B4\uAC04 \uCEE4\uD50C \uB450 \uAC00\uC9C0\uB97C \uB9DE\uCDB0\uBCF4\uC2DC\uC624(3\uC810)..\uC77C\uD558\uAE30 \uC2EB\uC73C\uB2C8 \uC774\uB7F0 \uAC1C\uC18C\uB9B4..",
