  "text" : "\uD398\uC544\uB178\uB9AC\uC548 \uBED8 \uB3D9\uC778\uC124\uC815~\n\uB9C8\uC5D0\uB4DC\uB85C\uC2A4: \uB3D9\uC0DD\uC774 \uAC16\uACE0 \uC2F6\uC5C8\uB2E4. \uC774\uB807\uAC8C \uC0AC\uB0B4\uB188\uB4E4\uB9CC \uB9CE\uC774 \uC0DD\uAE38 \uC904 \uBAB0\uB790\uC9C0\uB9CC.\n\uB9C8\uAE00\uB85C\uB974: \uC5EC\uB3D9\uC0DD\uC774 \uC81C\uC77C \uAC16\uACE0 \uC2F6\uC5C8\uB358 \uC790. \uC30D\uB465\uC774\uB9C8\uC800 \uB0A8\uC790\uC600\uC744 \uB54C\uB294 \uC6B8 \uBED4 \uD568\n\uCF08\uB808\uACE0\uB984: \uAC19\uC774 \uB180 \uC218 \uC788\uB294 \uB0A8\uB3D9\uC0DD! \uADFC\uB370 \uB137\uC774\uB098 \uC0DD\uAE38 \uC904\uC740..",
